CURRENTLY: Working on a new, cleaner client.java, will copy it here so u can paste :)

I was working on this project over this easter break, now when school start I have no use for it since it isn't a server anyone wanna play, but you can use it as a base if you wish.

What I did was copy old RuneScape, put NPC's in ordinary places, correct NPC drops and working skills, clean the commands, add special features like "Pick Wheit", "Pick Cabbage", "Pick Potato". When you train woodcutting you can also be visited by a Tree spirit! (See pictures).

[b]Yes[/b], this is [u]Delta[/u] based.

